import { useState } from 'react';

export default function NavigationBar() {
  const [isOpen, setMobileMenuOpen] = useState(true);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <nav className="bg-gray-900 border-gray-200">
      <div className="max-w-screen-xl flex flex-wrap items-center justify-between mx-auto p-4">
        <a href="index.html" className="flex items-center">
          <img src="assets/icons/programmer.png" className="h-8 mr-3" alt="Logo" />
          <span className="self-center text-2xl font-semibold text-white">Rashed Alaleeli</span>
        </a>

        <div className="md:hidden inline-flex items-center">
          <button className="outline-none mobile-menu-button" onClick={toggleMobileMenu}>
            <svg
              className={`w-6 h-6 text-gray-500 hover:text-gray-700`}
              fill="none"
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="2"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path d="M4 6h16M4 12h16M4 18h16"></path>
            </svg>
          </button>
        </div>

        <div className={`w-full md:block md:w-auto ${isMobileMenuOpen ? 'hidden' : ''}`}>
          <ul className="font-medium flex flex-col p-4 md:p-0 mt-4 rounded-lg bg-gray-50 md:flex-row  md:mt-0 md:space-x-8 md:border-0 dark:bg-gray-800 md:dark:bg-gray-900 dark:border-gray-700">
            <NavLink>Home</NavLink>
            <NavLink>Projects</NavLink>
            <NavLink>About</NavLink>
            <NavLink>Contact</NavLink>
          </ul>
        </div>
      </div>
    </nav>
  );
}

function NavLink({href, children}) {
  return (
    <li>
      <a href={href} className="block py-2 pl-3 pr-4 text-white rounded hover:bg-gray-500 md:hover:bg-transparent md:border-0 hover:text-blue-700 md:p-0">
        {children}
      </a>
    </li>
  )
}
